def float_precision_and_digits(number: float):
    # Convert the float to string in a fixed-point format
    number_str = f"{number:.16f}".rstrip('0')  # Limit to 16 decimal places, remove trailing zeros

    if '.' in number_str:
        integer_part, fractional_part = number_str.split('.')
        fractional_part = fractional_part if fractional_part != "" else "0"
        precision = len(fractional_part)  # Number of digits after the decimal point
    else:
        integer_part, fractional_part = number_str, ''
        precision = 0

    total_digits = len(integer_part.replace('-', '')) + len(fractional_part)

    return total_digits, precision

